import VideoComp from './videoComp';
import React from 'react';

export const Page1 = () => {
    const btn: HTMLButtonElement = document.getElementById('btn') as HTMLButtonElement;
    const sideBar: HTMLCanvasElement = document.getElementById('sideBar') as HTMLCanvasElement;
    const btn1 = document.getElementById('btn1') as HTMLButtonElement;
    sideBar.hidden = true;

    const event = () => {
        btn.hidden = true;
        sideBar.hidden = false;
    };
    btn.onclick = event;
    return (
        <div>
            <h1>ハンバーガーを作ろう</h1>
            <button id="btn1">ボタン1</button>
            <button id="btn2">ボタン2</button>
            <button id="btn3">ボタン3</button>
            <button id="btn4">ボタン4</button>
            <VideoComp/>
        </div>
    );
};
